import React from 'react';
import Notes from './Notes.js';
import Login from './Login.js';

const Home = (props) => {
    const {showAlter}=props;
    return (
        <div> 
            <Route path="/login" element={<Login showAlert={showAlert} />} />
            <Notes showAlter={showAlter} />
        </div>
    )
}

export default Home
